@Bianca Massone Come carne bovina?! , a mesma coisa  tudo que nós comemos é cheio de produtos químicos , que a qualquer hora pode surgir uma grande epidemia!

Entendi uma coisa que morcegos vivem seu ciclo de vida a qualquer hora pode bater uma fome neles e querer morder algum animal ( vaca , porco e etc) e sim os que vender a carne que foi mordida pelo morcego irá causar uma contaminação em uma pessoa e daí vai começar a espirrar , tosse ceca( não sei como escreve isso) , e daí surgirar uma grande epidemia um se contaminando o outro até chegar o fim!!

   *Você tem que entender isso não importa o animal que nós comemos todos tem produtos químicos qualquer hora surgir uma epidemia* .

